import { Component } from "react";

class Country extends Component{

    render(){
        return(
            <div className="col-md-3">
<img src="https://flagcdn.com/w320/fi.png"/>
<h4>finland</h4>
<ul>
<li>pop:22020</li>
<li>regiou:europe</li>
<li>capital:berlin</li>
</ul>
            </div>
        )
    }
}
export default Country
